import numpy as np
import numba
from numba import njit

# Test 1: Direct numpy call with size as integer
print("Test 1: NumPy behavior with size as integer")
rng_np = np.random.default_rng(42)
result_np = rng_np.random(5)
print(f"NumPy result shape: {result_np.shape}")
print(f"NumPy result: {result_np}")

# Test 2: Numba compiled function with size as integer
print("\nTest 2: Numba behavior with size as integer")
@njit
def test_random_int_size(rng, size):
    return rng.random(size)

rng_numba = np.random.default_rng(42)
try:
    result_numba = test_random_int_size(rng_numba, 5)
    print(f"Numba result shape: {result_numba.shape}")
    print(f"Numba result: {result_numba}")
except Exception as e:
    print(f"Error: {e}")

